import { Heading,Box } from "@chakra-ui/react";
import { motion } from "framer-motion";

const Slide = () => {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 20 }}
    >
    <Box></Box>
      <Heading  left="30" size="lg">
        Novel Cloud Storage Native Approach
      </Heading>
      <Heading pos="fixed" top="230" left="30" size="sm">
        Solution Benefits
      </Heading>
      <Heading pos="fixed" top="250" left="30" size="sm">
        1>improved Performance
      </Heading>
      <Heading pos="fixed" top="250" left="30" size="sm">
        2>Scalability
      </Heading>
    </motion.div>
  );
};

export default Slide;
